import { Link } from "react-router-dom";

export default function ViewData(props ) {
return (
  <div>
    <div class="card">
      <img src={props.img} class="card-img-top" alt="..." />
      <div class="card-body">
        <h5 class="card-title">{props.title}</h5>
        <p class="card-text">
        
        </p>
        <Link href="/" class="btn btn-primary">
          Go somewhere
        </Link>
      </div>
    </div>
  </div>
);
}
